def randg(N):
    g = []
    for i in range(N):
        Ni = random.randint(0, N)
        g.append(tuple(random.sample(range(N), Ni)))
    return tuple(g)

def g2p(g):
    N = len(g)
    p = np.zeros((N, N))
    for i, olinks in enumerate(g):
        if len(olinks) > 0:
            p[i, olinks] = 1.0 / float(len(olinks))
    return p

def g2p_pagerank(g, alpha):
    N = len(g)
    p = g2p(g)
    return alpha * p + (1.0 - alpha) * np.ones((N, N)) / float(N)

def power_iter_one_step(x, p):
    xtp = np.dot(x.T, p)
    return xtp / xtp.sum()
